import React from "react";
import logo from '../components/public/image/labyrinth.jpg';


console.log(logo);

export const MarketPlace = (props) => {
  return (
    <div> 
      <h1>This is the (external) market place!</h1>
      <div>Choose a club of you choice:</div>
      <div>
        <ul>
          <li><img src={logo} alt="Logo" /></li>
          <li>Club ticket #2</li>
          <li>Club ticket #3</li>
        </ul>
      </div>
    </div>
  );
};
